import React, { FC } from "react";
import "./App.css";
import Statistic from "./components/Statistic";
import TodoList from "./components/TodoList";
import AddTodo from "./components/AddTodo";

const App: FC = () => {
  return (
    <div>
      <Statistic />
      <TodoList />
      <AddTodo />
    </div>
  );
};

export default App;
